import React from "react";

const About = () => {
  return (
    <section id="about_me">
      <div>
        <h1 className="mono">Hi, I'm Abe Raouh</h1>
        <p>Software Engineer based in New York, NY</p>
        <p>ML/AI enthusiast</p>
      </div>
      <div>
        <img src="img/portrait2.jpeg" width="420px" alt="" />
      </div>
    </section>
  );
};

export default About;
